(6,	1,	18,	'Кто онлайн',	'Я сделал возможность просмотра списка пользователей &quot;онлайн&quot;. На главной странице там где показывается сколько онлайн теперь ссылка. И еще небольшая правка, теперь в профиле адрес сайта как ссылка',	'1305348705',	1),
